class EmailAuthBackend(object):
    """
    Consolidated authentication backend that supports both django_User and Provider models.
    The `authenticate` method can be used to authenticate a user by email and password,
    or simply retrieve a user instance by email without password verification.
    """

    def _get_user(self, username, user_model):
        """
        Retrieve a user instance based on the provided username and user model.
        For django_User, lookup by email.
        For Provider, lookup by idUser__mail__contains.
        """
        if user_model == Provider:
            return Provider.objects.filter(idUser__mail__contains=username).first()
        else:
            return user_model.objects.get(email=username)

    def authenticate(self, username=None, password=None, user_model=django_User, check_password_flag=True):
        """
        Authenticate a user by email and password or retrieve a user instance without password verification.

        Parameters
        ----------
        username : str
            The email address used for authentication.
        password : str, optional
            The password to verify. Ignored if `check_password_flag` is False.
        user_model : Model, optional
            The Django model to query. Defaults to django_User.
        check_password_flag : bool, optional
            If True, verify the password. If False, simply return the user instance.

        Returns
        -------
        User instance or None
            The authenticated user or None if authentication fails.
        """
        if not username:
            return None

        try:
            user = self._get_user(username, user_model)
            if not user:
                return None

            if check_password_flag:
                if password is None:
                    return None
                # Ensure the user has a password attribute before checking
                if hasattr(user, 'password') and check_password(password, user.password):
                    return user
                return None
            else:
                return user

        except (django_User.DoesNotExist, Provider.DoesNotExist, User.DoesNotExist):
            return None
        except Exception:
            # Generic exception catch to avoid leaking sensitive information
            return None


